<div class="entities" style="line-height: 2.5; direction: ltr">Genetic and epigenetic markers in the evaluation of pancreatic masses . BACKGROUND : Methylation markers have shown promise in the early diagnosis of pancreatic carcinoma . The aim of this study was to assess the diagnostic utility of hypermethylation status of candidate genes in combination with

</mark>
 mutation detection in the evaluation of pancreatic masses . EXPERIMENTAL DESIGN : Sixty-one fine needle aspirates of pancreatic masses ( 43 pancreatic adenocarcinomas and 18 chronic pancreatitis ) were studied . Methylation status of

</mark>
 , Q05925 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , P55290 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 were analysed using melting curve analysis after DNA bisulfite treatment . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 mutations showed a sensitivity of 77 % ( 33 of 43 , CI 95 % 62 to 88 % ) and a specificity of 100 % . Both molecular analyses added useful information to cytology by increasing the number of informative cases . When genetic and epigenetic analyses were combined sensitivity was 84 % ( 36 of 43 CI 95 % 69 to 93 % ) maintaining a 100 % specificity . CONCLUSIONS : Analysis of hypermethylation status of a panel of genes and

 mutation detection offer a similar diagnostic yield in the evaluation of pancreatic masses . The combined molecular analysis increases the number of informative cases without diminishing specificity .</div>
